package fetcher

import (
	"context"
	"encoding/base64"
	"sync"
	"testing"
	"time"

	"github.com/stretchr/testify/require"
	"github.com/xssnick/tonutils-go/liteclient"
	"github.com/xssnick/tonutils-go/ton"
	"github.com/xssnick/tonutils-go/tvm/cell"

	"github.com/tonindexer/anton/internal/app"
	"github.com/tonindexer/anton/internal/app/parser"
)

const bcConfigBase64 = ""

var (
	bcConfig *cell.Cell
)

func init() {
	bcConfigBOC, err := base64.StdEncoding.DecodeString(bcConfigBase64)
	if err != nil {
		panic(err)
	}
	bcConfig, err = cell.FromBOC(bcConfigBOC)
	if err != nil {
		panic(err)
	}
}

func newService(t *testing.T) *Service {
	p := parser.NewService(&app.ParserConfig{
		BlockchainConfig:         bcConfig,
		ContractRepo:             nil,
		MaxAccountParsingWorkers: 96,
	})

	client := liteclient.NewConnectionPool()
	err := client.AddConnection(context.Background(), "135.181.177.59:53312", "aF91CuUHuuOv9rm2W5+O/4h38M3sRm40DtSdRxQhmtQ=")
	if err != nil {
		t.Fatal(err)
	}
	api := ton.NewAPIClient(client, ton.ProofCheckPolicyUnsafe).WithRetry()

	return NewService(&app.FetcherConfig{
		API:    api,
		Parser: p,
	})
}

func TestService_BlockTransactions(t *testing.T) {
	s := newService(t)

	ctx := context.Background()

	for seq := 29661500; seq < 29661510; seq++ {
		var wg sync.WaitGroup

		master, shards, err := s.UnseenBlocks(ctx, uint32(seq))
		if err != nil {
			t.Fatal(err)
		}

		ts := time.Now()

		wg.Add(len(shards) + 1)

		go func() {
			defer wg.Done()
			_, err = s.BlockTransactions(ctx, master, master)
			require.Nil(t, err)
		}()

		for i := range shards {
			go func(shard *ton.BlockIDExt) {
				defer wg.Done()
				_, err := s.BlockTransactions(ctx, master, shard)
				require.Nil(t, err)
			}(shards[i])
		}

		wg.Wait()

		t.Logf("%d: elapsed %s", seq, time.Since(ts))
	}
}
